import React from 'react'

let feedItemStyle = {
    width: '400px',
    height: '100px',
    backgroundColor: '#fff',
    color: '#fff'
}

const feedItem = (props) => {
    return(
        <div className = {feedItemStyle}>
            <p>{props.plateNumber}</p>
            <p>Activate BTN</p>
            <p>*Edit BTN*</p>
            <p>*Remove BTN</p>
        </div>
    )
}

export default feedItem
